const fetch = require('node-fetch');

const Transport = {
  async post(url, data) {
    console.log(locId);
    fetch("http://localhost:1337/open-weather", 
      { 
        method: 'POST', 
        body: {locId: locId}
      })
      .then(res => res.text())
      .then(res => console.log(res));
  }
}

module.exports = Transport;
